            var html_9c0c4c1490c94be88bd2b9454930f4c3 = $(`<div id="html_9c0c4c1490c94be88bd2b9454930f4c3" style="width: 100.0%; height: 100.0%;"><h1>Топарское водохранилище</h1> <p> Топарское водохранилище, известное также, как Шерубайнуринское, расположено приблизительно в трех десятках километров к юго-западу от Караганды. Оно является одним из наиболее крупных водохранилищ Казахстана. Его протяженность составляет 13 километров, при ширине немногим более 4 километров. </p> <img src='{% static 'images/Topar.JPG' %}'/></div>`)[0];
